import { Job } from '../entities/Job';
import JobComponent from './JobComponent';

const JobList = ({allJobs} : {allJobs: Job[]}) => {

  return (
    <ul>
        {allJobs.length > 0 ? '<p>The relevant jobs are:</p>': ''}
        {allJobs.map( job => (
            <JobComponent job={job}></JobComponent>
        ))}
    </ul>
  );
}

export default JobList;
